INSERT INTO `source_database` VALUES (2,'AlgaeBase','AlgaeBase',NULL,'M Guiry','Martin Ryan Institute, National University of Ireland, Galway, Ireland','M Guiry','3.0, Dec 2004','2004-12-14','Algaebase aspires to include all organisms regarded as algae, including the Cyanophyta (or Cyanobacteria). Primarily a taxonomic database, it has diverse information on freshwater, marine (seaweeds) and terrestrial algae, including uses and many pictures. Seagrasses are also included for the present. About 55,000 names are currently documented. AlgaeBase was developed at the Martin Ryan Institute, National University of Ireland, Galway, with support from the Higher Education Authority (Irish Department of Education and Science) and the European Commission.'),(10,'FishBase','FishBase',NULL,'R Froese & D Pauly (eds)','WorldFish; FAO;  IfM-GEOMAR;  FC-UBC; MNHN; RMCA; NRM; AUTH; CAFS','R Froese & D Pauly (eds)','Dec 2008','2008-12-30','FishBase is a global information system with extensive information on all species of fish. In addition to the data contributed to the Catalogue of Life, the original FishBase database also includes descriptive, physiological and conservation data and onward links to information in many other databases. It is supported by a consortium of nine institutions including the Food and Agriculture Organization of the United Nations. Data entry and maintenance is done mainly at the WorldFish Center in the Philippines, in collaboration with many other partners, and with support from the European Commission.'),(16,'IOPI Global Plant Checklist','IOPI-GPC',NULL,'KL Wilson and WG Berendsohn (eds)','International Organization for Plant Information (IOPI)','KL Wilson and WG Berendsohn (eds)','10.0, Aug 2007','2007-08-01','The International Organization for Plant Information (IOPI) aims to produce a database of all vascular plant species and other products such as a World Flora. The checklist currently holds over 200,000 names and implements the innovative potential taxon concept. Data for the cycads and 6 flowering plant families are included in this Annual Checklist. Cycad data come from World List of Cycads (htttp://plantnet.rbgsyd.nsw.gov.au/PlantNet/cycad/) maintained by KD Hill (NSW) & DW Stevenson (New York Botanical Garden), 2004. Casuarinaceace data supplied by KL Wilson and LAS Johnson (†) (Royal Botanic Gardens Sydney), 1996. Chrysobalanaceae data supplied by GT Prance & CA Sothers (Royal Botanic Gardens Kew), 2005. Eucalypt data supplied by KD Hill & LC Stanberg (Royal Botanic Gardens Sydney), 2004. Irvingiaceae data supplied by DJ Harris (Royal Botanic Garden, Edinburgh), 1999. Juncaceae data compiled by J Kirschner (Institute of Botany, Pruhonice), 2004. Rosaceae data added by R Pankhurst (Royal Botanic Garden, Edinburgh) in 2005, revised in 2006/7.'),(17,'The Integrated Taxonomic Information System','ITIS',NULL,'T Orrell (custodian)','The Integrated Taxonomic Information System (ITIS)','T Orrell (custodian)','Nov 2008','2008-11-12','ITIS supplies both global and New World groups to the Catalogue of Life – with emphasis on GSDs. ITIS develops taxonomic coverage of all biota of interest to North America and contains over 591,000 scientific and common names and has either a global or New World treatment of many groups.'),(18,'The Global Lepidoptera Names Index','LepIndex',NULL,'GW Beccaloni, MJ Scoble, GS Robinson & B Pitkin','Natural History Museum, London, UK','GW Beccaloni, MJ Scoble, GS Robinson & B Pitkin','12.2, Jun 2005','2005-06-15','LepIndex is a digitised and updated version of the unique index card archive to the scientific names of the living and fossil butterflies and moths of the world at the Natural History Museum (London). This card index was produced by the museum’s lepidopterists over many decades and it contains about 9 % of all published Lepidoptera names (90,099 in total), including misspellings and misidentifications.'),(26,'Systematic Database of the Scale Insects of the World','ScaleNet',NULL,'Y Ben-Dov & DR Miller','Agricultural Research Organization, Bet Dagan, Israel; USDA, Systematic Entomology Laboratory, Beltsville, USA','Y Ben-Dov & DR Miller','Dec 2004','2004-12-05','The ScaleNet site provides comprehensive information on the scale insects (Hemiptera: Coccoidea) of the world, including queriable information on their classification, nomenclatural history, geographical distribution, host plants, natural enemies, economic importance and literature. Currently information can be retrieved for 27 families, and data of about 21,000 references dating from 1758 to the present. Ultimately, information will be provided for all 28 families of scale insects, comprising more than 7,500 species.'),(32,'Cerambycidae database','TITAN',NULL,'G Tavakilian','Institut de Recherche pour le Développement (IRD), Paris, France','G Tavakilian','Oct 2006','2005-10-25','This database is gathering the complete bibliography of the American species of Cerambycidae (sensu lato), Timber beetles. The main references for European species (completely represented) and many for the species from other continents are being added gradually. There are currently more than 29,000 taxa included and 21,000 types, as well as their host plants if known.'),(67,'ITIS World Bee Checklist','ITIS Bees',NULL,'T Orrell (custodian)','The Integrated Taxonomic Information System (ITIS)','T Orrell (custodian)','Nov 2008','2008-11-01','Together with specialists around the world, ITIS has completed a checklist of the bee species of the world. The checklist (with some synonyms and subspecies) is integrated into the ITIS database. Project led by M Ruggiero (ITIS). Principal scientific contributors: JS Ascher (AMNH, USA), C Eardley (PPRI, South Africa), T Griswold (USDA, USA), G Melo (Federal University of Parana, Brazil), A Polaszek (NHM, UK), O Tadauchi (University of Kyushu, Japan), K Walker (Museum Victoria, Australia), N Warrit (NMNH, USA), and P Williams (NHM, UK). Principal technical contributors: D Nicolson (USGS, USA); J Pickering (Discover Life and University of Georgia, USA) and D Remsen (GBIF, Denmark).');
